import React from 'react';
import classes from './ErrorLog.module.css';

const errorLog = () => {
  return (
    <div className={classes.ErrorLog}>
      <textarea>
        <p>SUCCESS: Node 1 created</p>
        <p>SUCCESS: Node 2 created</p>
        <p>ERROR: Nodes cannot be linked</p>
      </textarea>
    </div>
  );
}

export default errorLog;
